import React from 'react';
import { NavLink } from 'react-router-dom';
import './Ccovid.css'

const Menu =()=>{
    return(
        <> 
             <div className='navbar'>
                 <NavLink exact className='.active' to='/'>about us</NavLink>
            </div>
        </>
    )

}
export default Menu
